import React from 'react';
import AppointmentPage from './components/AppointmentPage';
import './components/style.css';


function App() {
  return (
    <div id="Container">

      <h1>Book Appointment</h1>
      
      <AppointmentPage />
    </div>
  );
}

export default App;
